    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) WHERE NOT + - col1 BETWEEN 33 * 91 * - - col1 + - col1 AND + col0 * 41 + + col2;
  - name: tab0

outputs:
  - name: q1819.out
    data: |
      15	81	47
      87	21	10
      97	1	99
